package q44_WildcardMatching;

public class Solution_tle {

	Boolean[][] f = null;
	String s;
	String p;

	private boolean search(int i, int j) {
		if (f[i][j] != null)
			return f[i][j];
		if (j == 0) {
			if (i > 0)
				f[i][j] = false;
			return f[i][j];
		}
		if (i == 0) {
			f[i][j] = false;
			int k = 0;
			while (k < j && p.charAt(k) == '*') {
				k++;
			}
			if (k == j) {
				for (int tt = 0; tt <= j; tt++)
					f[i][tt] = true;
			}
			return f[i][j];
		}
		if (p.charAt(j - 1) == '?' || s.charAt(i - 1) == p.charAt(j - 1)) {
			f[i][j] = search(i - 1, j - 1);
			return f[i][j];
		} else if (p.charAt(j - 1) == '*') {
			for (int index = i; index >= 0; index--) {
				if (search(index, j - 1)) {
					f[i][j] = true;
					return f[i][j];
				}
			}
			f[i][j] = false;
			return f[i][j];
		} else {
			f[i][j] = false;
			return f[i][j];
		}
	}

	public boolean isMatch(String s, String p) {
		if (s == null || p == null)
			return false;
		if ("".equals(p)) {
			if ("".equals(s))
				return true;
			return false;
		}
		this.s = s;
		this.p = p;
		f = new Boolean[s.length() + 1][];
		for (int i = 0; i <= s.length(); i++)
			f[i] = new Boolean[p.length() + 1];
		f[0][0] = true;

		return search(s.length(), p.length());
	}

	public static void main(String[] args) {
		new Solution_tle().isMatch("", "**");
	}
}